import { useState } from "react";
import { Link, useNavigate } from "react-router-dom"
import Button from "../UI/Button";
import classes from "./SignUpPage.module.css"

const SignUpPage = () => {
    const [isSignedUp, setIsSignedUp] = useState(false);
    const navigate = useNavigate();
    const signUpHandler = event => {
        event.preventDefault();
        setIsSignedUp(true);
        navigate("/products");
    };

    return <>
        <div className={classes.signin}>
            <h4>I already have an account</h4>
            <Link to="/"><button>Sign In</button></Link>
        </div>
        <form onSubmit={signUpHandler} className={classes.form}>
            <div>
                <label htmlFor="name">Name*</label>
                <input id="namr" name="name" placeholder="Name" />
            </div>
            <div>
                <label htmlFor="surname">Surname*</label>
                <input id="surname" name="surname" placeholder="Surname" />
            </div>
            <div>
                <label htmlFor="email">Email</label>
                <input id="email" name="email" placeholder="Email-adresse" />
            </div>
            <div>
                <label htmlFor="password">Password</label>
                <input id="password" name="password" placeholder="Password" />
                <p className={classes.p}>*It has to be at least 8 characters long</p>
            </div>
            <Button type="submit">Register</Button>
        </form>
    </>
};

export default SignUpPage;
